DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS WITH with_0 AS (SELECT t_3.c5 AS col_0, true AS col_1, t_3.c7 AS col_2 FROM alltypes1 AS t_3 GROUP BY t_3.c1, t_3.c9, t_3.c5, t_3.c7, t_3.c11, t_3.c10, t_3.c3, t_3.c4 HAVING (t_3.c4 <= ((SMALLINT '580') | (SMALLINT '404')))) SELECT (DATE '2022-10-05' + (INT '915')) AS col_0 FROM with_0 WHERE false;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
